var dashboardModule=new Vue({el:"#root",data:{debug:DEBUGMODE,loader:!0,users:[],files:[],pages:[],forms_types:[],albumes:[],content:[],api_data:{dashboard:BASEURL+"api/v1/dashboard/"}},mixins:[mixins],methods:{init(){setTimeout(()=>{var e=document.querySelectorAll(".dropdown-trigger");M.Dropdown.init(e,{});e=document.querySelectorAll(".collapsible");M.Collapsible.init(e,{})},3e3)}},mounted:function(){this.$nextTick((function(){Promise.all([fetch(this.api_data.dashboard).then(e=>e.json())]).then(([e])=>{this.users=e.data.users.map(e=>new User(e)),this.pages=e.data.pages.map(e=>(e.user=new User(e.user),e)),this.forms_types=e.data.forms_types,this.content=e.data.content.map(e=>(e.user=new User(e.user),e.status="1"==e.status,e)),this.files=e.data.files.map(e=>new ExplorerFile(e)),this.albumes=e.data.albumes.map(e=>(e.user=new User(e.user),e)),this.loader=!1,this.init()})}))}});